    let brand: String
    let purchaseDate: Date
    let purchasePrice: Double
    let warrantyPeriod: Date
    let imageAssets: [URL]
    let pdfAssets: [URL]
    let repairModels: [RepairModel]
}

struct RepairModel: Identifiable, Codable {
    let id: String
    
    let name: String
    let repairDate: Date
    let repairPrice: Double
    let warrantyPeriod: Date
}
```

